import './App.css';
import styled, { ThemeProvider } from "styled-components";
import { darkTheme } from "./utils/Themes"

const Body = styled.div`
  background-color: ${({theme}) => theme.bg};
  width: 100%;
  height: 100%;
  overflow-x: Hidden;
  `;

const Wrapper = styled.div`
  background : linear-gradient(
    38.73deg,
    rgba(284,0,187,0.15) 0%,
    rgba(201,32,184,0) 50%
  ),
  linear-gradient(
    141.27deg,
    rgba(0,70,209,0) 50%,
    rgba(0,70,209,0.15) 100%
  );
  width: 100%;
  clip-path: polygon(0 0,100% 0,0 calc(100%-5vw));
`;

function App() {
  return (
    <ThemeProvider theme = {darkTheme}>
      <Navbar>
      <Body>
        <HeroSection>
          <Wrapper>
            <Skills>

            </Skills>

          </Wrapper>


        </HeroSection>

      </Body>
      </Navbar>
    </ThemeProvider>
  );
}

export default App;
